                    Document title: Guidance note Isolation of plant 2010
                    Document summary: The guidance note issued by the Commission for Occupational Safety and Health in Western Australia focuses on the isolation of plant to prevent workplace injuries. It outlines legislative frameworks, basic principles, and procedures for isolating plant, including risk management and alternative measures when isolation is not practicable. The document emphasizes the importance of strict adherence to isolation procedures and provides detailed steps for identifying and managing energy sources and other hazards. It also outlines the responsibilities of employers and workers under the Occupational Safety and Health Act 1984, and includes information on various isolation devices, tagging systems, and procedures for safely de-energizing equipment, along with additional resources and contact information for further assistance.
                    ----

                    Section name: 8. Energy sources                
                    Text content: Plant energy sources include:
• electricity (mains, solar and by generator);
• chemicals;
• fuels;
• heat;
• steam;
• pneumatic pressure (compressed air);
• fluids under pressure, such as water or hydraulic oil;
• energy storing devices, such as batteries, springs, flywheels, accumulators and capacitors;
• gravity; and
• radiation.



